import React, { Component } from 'react';

class LongTermGoal extends Component {
  constructor(props) {
    super(props);

    this.handleCompletedGoal = this.handleCompletedGoal.bind(this);
  }

  handleCompletedGoal(event) {
    event.preventDefault();
    const id = this.props.id;
    const description = this.props.description;
    const timescale = this.props.timescale;
    this.props.handleCompletedGoalTransfer({id:id, description: description, timescale: timescale});
  }
  render() {
    return (
      <tbody>
        <tr>
          <td>{this.props.id}</td>
          <td>{this.props.description}</td>
          <td>{this.props.timescale}</td>
          <td><input type="button" value="Goal Completed &#10004;"/></td>
        </tr>
      </tbody>
    )
  }

  }

export default LongTermGoal;
